int_rules_7_2_6 = @theory begin

    #= ::Subsection::Closed:: =#
    #= 7.2.6*Miscellaneous*inverse*hyperbolic*cosine =#
    @apply_utils Antiderivative((~(a') + ~(b') * acosh(~c + ~(d') * ~x)) ^ ~(n'), ~x) => (1 / ~d) * Subst(Antiderivative((~a + ~b * acosh(~x)) ^ ~n, ~x), ~x, ~c + ~d * ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative((~(e') + ~(f') * ~x) ^ ~(m') * (~(a') + ~(b') * acosh(~c + ~(d') * ~x)) ^ ~(n'), ~x) => (1 / ~d) * Subst(Antiderivative(((~d * ~e - ~c * ~f) / ~d + (~f * ~x) / ~d) ^ ~m * (~a + ~b * acosh(~x)) ^ ~n, ~x), ~x, ~c + ~d * ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~f, ~m, ~n], ~x)
    @apply_utils Antiderivative((~(A') + ~(B') * ~x + ~(C') * (~x) ^ 2) ^ ~(p') * (~(a') + ~(b') * acosh(~c + ~(d') * ~x)) ^ ~(n'), ~x) => (1 / ~d) * Subst(Antiderivative((-(~C) / (~d) ^ 2 + (~C / (~d) ^ 2) * (~x) ^ 2) ^ ~p * (~a + ~b * acosh(~x)) ^ ~n, ~x), ~x, ~c + ~d * ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~A, ~B, ~C, ~n, ~p], ~x) && (EqQ(~B * (1 - (~c) ^ 2) + 2 * ~A * ~c * ~d, 0) && EqQ(2 * ~c * ~C - ~B * ~d, 0))
    @apply_utils Antiderivative((~(e') + ~(f') * ~x) ^ ~(m') * (~(A') + ~(B') * ~x + ~(C') * (~x) ^ 2) ^ ~(p') * (~(a') + ~(b') * acosh(~c + ~(d') * ~x)) ^ ~(n'), ~x) => (1 / ~d) * Subst(Antiderivative(((~d * ~e - ~c * ~f) / ~d + (~f * ~x) / ~d) ^ ~m * (-(~C) / (~d) ^ 2 + (~C / (~d) ^ 2) * (~x) ^ 2) ^ ~p * (~a + ~b * acosh(~x)) ^ ~n, ~x), ~x, ~c + ~d * ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~f, ~A, ~B, ~C, ~m, ~n, ~p], ~x) && (EqQ(~B * (1 - (~c) ^ 2) + 2 * ~A * ~c * ~d, 0) && EqQ(2 * ~c * ~C - ~B * ~d, 0))
    @apply_utils Antiderivative(sqrt(~(a') + ~(b') * acosh(1 + ~(d') * (~x) ^ 2)), ~x) => ((2 * sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)) * sinh((1 / 2) * acosh(1 + ~d * (~x) ^ 2)) ^ 2) / (~d * ~x) - (sqrt(~b) * sqrt(pi / 2) * (cosh(~a / (2 * ~b)) - sinh(~a / (2 * ~b))) * sinh((1 / 2) * acosh(1 + ~d * (~x) ^ 2)) * erfi((1 / sqrt(2 * ~b)) * sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)))) / (~d * ~x)) + (sqrt(~b) * sqrt(pi / 2) * (cosh(~a / (2 * ~b)) + sinh(~a / (2 * ~b))) * sinh((1 / 2) * acosh(1 + ~d * (~x) ^ 2)) * erf((1 / sqrt(2 * ~b)) * sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)))) / (~d * ~x) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(sqrt(~(a') + ~(b') * acosh(-1 + ~(d') * (~x) ^ 2)), ~x) => ((2 * sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) * cosh((1 / 2) * acosh(-1 + ~d * (~x) ^ 2)) ^ 2) / (~d * ~x) - (sqrt(~b) * sqrt(pi / 2) * (cosh(~a / (2 * ~b)) - sinh(~a / (2 * ~b))) * cosh((1 / 2) * acosh(-1 + ~d * (~x) ^ 2)) * erfi((1 / sqrt(2 * ~b)) * sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)))) / (~d * ~x)) - (sqrt(~b) * sqrt(pi / 2) * (cosh(~a / (2 * ~b)) + sinh(~a / (2 * ~b))) * cosh((1 / 2) * acosh(-1 + ~d * (~x) ^ 2)) * erf((1 / sqrt(2 * ~b)) * sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)))) / (~d * ~x) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative((~(a') + ~(b') * acosh(~c + ~(d') * (~x) ^ 2)) ^ ~n, ~x) => (~x * (~a + ~b * acosh(~c + ~d * (~x) ^ 2)) ^ ~n - (2 * ~b * ~n * (2 * ~c * ~d * (~x) ^ 2 + (~d) ^ 2 * (~x) ^ 4) * (~a + ~b * acosh(~c + ~d * (~x) ^ 2)) ^ (~n - 1)) / (~d * ~x * sqrt(-1 + ~c + ~d * (~x) ^ 2) * sqrt(1 + ~c + ~d * (~x) ^ 2))) + 4 * (~b) ^ 2 * ~n * (~n - 1) * Antiderivative((~a + ~b * acosh(~c + ~d * (~x) ^ 2)) ^ (~n - 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d], ~x) && (EqQ((~c) ^ 2, 1) && GtQ(~n, 1))
    @apply_utils Antiderivative(1 / (~(a') + ~(b') * acosh(1 + ~(d') * (~x) ^ 2)), ~x) => (~x * cosh(~a / (2 * ~b)) * CoshIntegral((~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (sqrt(2) * ~b * sqrt(~d * (~x) ^ 2)) - (~x * sinh(~a / (2 * ~b)) * SinhIntegral((~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (sqrt(2) * ~b * sqrt(~d * (~x) ^ 2)) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / (~(a') + ~(b') * acosh(-1 + ~(d') * (~x) ^ 2)), ~x) => (-(~x) * sinh(~a / (2 * ~b)) * CoshIntegral((~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (sqrt(2) * ~b * sqrt(~d * (~x) ^ 2)) + (~x * cosh(~a / (2 * ~b)) * SinhIntegral((~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (sqrt(2) * ~b * sqrt(~d * (~x) ^ 2)) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / sqrt(~(a') + ~(b') * acosh(1 + ~(d') * (~x) ^ 2)), ~x) => (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) - sinh(~a / (2 * ~b))) * sinh(acosh(1 + ~d * (~x) ^ 2) / 2) * erfi(sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / (sqrt(~b) * ~d * ~x) + (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) + sinh(~a / (2 * ~b))) * sinh(acosh(1 + ~d * (~x) ^ 2) / 2) * erf(sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / (sqrt(~b) * ~d * ~x) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / sqrt(~(a') + ~(b') * acosh(-1 + ~(d') * (~x) ^ 2)), ~x) => (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) - sinh(~a / (2 * ~b))) * cosh(acosh(-1 + ~d * (~x) ^ 2) / 2) * erfi(sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / (sqrt(~b) * ~d * ~x) - (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) + sinh(~a / (2 * ~b))) * cosh(acosh(-1 + ~d * (~x) ^ 2) / 2) * erf(sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / (sqrt(~b) * ~d * ~x) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / (~(a') + ~(b') * acosh(1 + ~(d') * (~x) ^ 2)) ^ (3 / 2), ~x) => ((-(sqrt(~d * (~x) ^ 2)) * sqrt(2 + ~d * (~x) ^ 2)) / (~b * ~d * ~x * sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2))) + (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) - sinh(~a / (2 * ~b))) * sinh(acosh(1 + ~d * (~x) ^ 2) / 2) * erfi(sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / ((~b) ^ (3 / 2) * ~d * ~x)) - (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) + sinh(~a / (2 * ~b))) * sinh(acosh(1 + ~d * (~x) ^ 2) / 2) * erf(sqrt(~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / ((~b) ^ (3 / 2) * ~d * ~x) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / (~(a') + ~(b') * acosh(-1 + ~(d') * (~x) ^ 2)) ^ (3 / 2), ~x) => (-(sqrt(~d * (~x) ^ 2)) * sqrt(-2 + ~d * (~x) ^ 2)) / (~b * ~d * ~x * sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2))) + (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) - sinh(~a / (2 * ~b))) * cosh(acosh(-1 + ~d * (~x) ^ 2) / 2) * erfi(sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / ((~b) ^ (3 / 2) * ~d * ~x) + (sqrt(pi / 2) * (cosh(~a / (2 * ~b)) + sinh(~a / (2 * ~b))) * cosh(acosh(-1 + ~d * (~x) ^ 2) / 2) * erf(sqrt(~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / sqrt(2 * ~b))) / ((~b) ^ (3 / 2) * ~d * ~x) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / (~(a') + ~(b') * acosh(1 + ~(d') * (~x) ^ 2)) ^ 2, ~x) => ((-(sqrt(~d * (~x) ^ 2)) * sqrt(2 + ~d * (~x) ^ 2)) / (2 * ~b * ~d * ~x * (~a + ~b * acosh(1 + ~d * (~x) ^ 2))) - (~x * sinh(~a / (2 * ~b)) * CoshIntegral((~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (2 * sqrt(2) * (~b) ^ 2 * sqrt(~d * (~x) ^ 2))) + (~x * cosh(~a / (2 * ~b)) * SinhIntegral((~a + ~b * acosh(1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (2 * sqrt(2) * (~b) ^ 2 * sqrt(~d * (~x) ^ 2)) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative(1 / (~(a') + ~(b') * acosh(-1 + ~(d') * (~x) ^ 2)) ^ 2, ~x) => ((-(sqrt(~d * (~x) ^ 2)) * sqrt(-2 + ~d * (~x) ^ 2)) / (2 * ~b * ~d * ~x * (~a + ~b * acosh(-1 + ~d * (~x) ^ 2))) + (~x * cosh(~a / (2 * ~b)) * CoshIntegral((~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (2 * sqrt(2) * (~b) ^ 2 * sqrt(~d * (~x) ^ 2))) - (~x * sinh(~a / (2 * ~b)) * SinhIntegral((~a + ~b * acosh(-1 + ~d * (~x) ^ 2)) / (2 * ~b))) / (2 * sqrt(2) * (~b) ^ 2 * sqrt(~d * (~x) ^ 2)) <-- FreeQ([~a, ~b, ~d], ~x)
    @apply_utils Antiderivative((~(a') + ~(b') * acosh(~c + ~(d') * (~x) ^ 2)) ^ ~n, ~x) => (-(~x) * (~a + ~b * acosh(~c + ~d * (~x) ^ 2)) ^ (~n + 2)) / (4 * (~b) ^ 2 * (~n + 1) * (~n + 2)) + ((2 * ~c * (~x) ^ 2 + ~d * (~x) ^ 4) * (~a + ~b * acosh(~c + ~d * (~x) ^ 2)) ^ (~n + 1)) / (2 * ~b * (~n + 1) * ~x * sqrt(-1 + ~c + ~d * (~x) ^ 2) * sqrt(1 + ~c + ~d * (~x) ^ 2)) + (1 / (4 * (~b) ^ 2 * (~n + 1) * (~n + 2))) * Antiderivative((~a + ~b * acosh(~c + ~d * (~x) ^ 2)) ^ (~n + 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d], ~x) && (EqQ((~c) ^ 2, 1) && (LtQ(~n, -1) && NeQ(~n, -2)))
    @apply_utils Antiderivative(acosh(~(a') * (~x) ^ ~p) ^ ~(n') / ~x, ~x) => (1 / ~p) * Subst(Antiderivative((~x) ^ ~n * tanh(~x), ~x), ~x, acosh(~a * (~x) ^ ~p)) <-- FreeQ([~a, ~p], ~x) && IGtQ(~n, 0)
    @apply_utils Antiderivative(~(u') * acosh(~(c') / (~(a') + ~(b') * (~x) ^ ~(n'))) ^ ~(m'), ~x) => Antiderivative(~u * asech(~a / ~c + (~b * (~x) ^ ~n) / ~c) ^ ~m, ~x) <-- FreeQ([~a, ~b, ~c, ~n, ~m], ~x)
    @apply_utils Antiderivative(acosh(sqrt(1 + ~(b') * (~x) ^ 2)) ^ ~(n') / sqrt(1 + ~(b') * (~x) ^ 2), ~x) => ((sqrt(-1 + sqrt(1 + ~b * (~x) ^ 2)) * sqrt(1 + sqrt(1 + ~b * (~x) ^ 2))) / (~b * ~x)) * Subst(Antiderivative(acosh(~x) ^ ~n / (sqrt(-1 + ~x) * sqrt(1 + ~x)), ~x), ~x, sqrt(1 + ~b * (~x) ^ 2)) <-- FreeQ([~b, ~n], ~x)
    @apply_utils Antiderivative((~f) ^ (~(c') * acosh(~(a') + ~(b') * ~x) ^ ~(n')), ~x) => (1 / ~b) * Subst(Antiderivative((~f) ^ (~c * (~x) ^ ~n) * sinh(~x), ~x), ~x, acosh(~a + ~b * ~x)) <-- FreeQ([~a, ~b, ~c, ~f], ~x) && IGtQ(~n, 0)
    @apply_utils Antiderivative((~x) ^ ~(m') * (~f) ^ (~(c') * acosh(~(a') + ~(b') * ~x) ^ ~(n')), ~x) => (1 / ~b) * Subst(Antiderivative((-(~a) / ~b + cosh(~x) / ~b) ^ ~m * (~f) ^ (~c * (~x) ^ ~n) * sinh(~x), ~x), ~x, acosh(~a + ~b * ~x)) <-- FreeQ([~a, ~b, ~c, ~f], ~x) && (IGtQ(~m, 0) && IGtQ(~n, 0))
    @apply_utils Antiderivative(acosh(~u), ~x) => ~x * acosh(~u) - Antiderivative(SimplifyIntegrand((~x * D(~u, ~x)) / (sqrt(-1 + ~u) * sqrt(1 + ~u)), ~x), ~x) <-- InverseFunctionFreeQ(~u, ~x) && Not(FunctionOfExponentialQ(~u, ~x))
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * (~(a') + ~(b') * acosh(~u)), ~x) => ((~c + ~d * ~x) ^ (~m + 1) * (~a + ~b * acosh(~u))) / (~d * (~m + 1)) - (~b / (~d * (~m + 1))) * Antiderivative(SimplifyIntegrand(((~c + ~d * ~x) ^ (~m + 1) * D(~u, ~x)) / (sqrt(-1 + ~u) * sqrt(1 + ~u)), ~x), ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~m], ~x) && (NeQ(~m, -1) && (InverseFunctionFreeQ(~u, ~x) && (Not(FunctionOfQ((~c + ~d * ~x) ^ (~m + 1), ~u, ~x)) && Not(FunctionOfExponentialQ(~u, ~x)))))
    @apply_utils Antiderivative(~v * (~(a') + ~(b') * acosh(~u)), ~x) => With([w = IntHide(~v, ~x)], Dist(~a + ~b * acosh(~u), w, ~x) - ~b * Antiderivative(SimplifyIntegrand((w * D(~u, ~x)) / (sqrt(-1 + ~u) * sqrt(1 + ~u)), ~x), ~x) <-- InverseFunctionFreeQ(w, ~x)) <-- FreeQ([~a, ~b], ~x) && (InverseFunctionFreeQ(~u, ~x) && Not(MatchQ(~v, (~(c') + ~(d') * ~x) ^ ~(m') <-- FreeQ([c, d, m], ~x))))
    @apply_utils Antiderivative(ℯ ^ (~(n') * acosh(~u)), ~x) => Antiderivative((~u + sqrt(-1 + ~u) * sqrt(1 + ~u)) ^ ~n, ~x) <-- IntegerQ(~n) && PolyQ(~u, ~x)
    @apply_utils Antiderivative((~x) ^ ~(m') * ℯ ^ (~(n') * acosh(~u)), ~x) => Antiderivative((~x) ^ ~m * (~u + sqrt(-1 + ~u) * sqrt(1 + ~u)) ^ ~n, ~x) <-- RationalQ(~m) && (IntegerQ(~n) && PolyQ(~u, ~x))
end
